import React, { Component } from "react";
import { Button } from "@material-ui/core";

class AddToCart extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Button style={{ backgroundColor: "#f44336" }} variant="contained">
        Buy
      </Button>
    );
  }
}

export default AddToCart;
